import React from 'react'
import { Image,ImageBackground,StyleSheet, Text, View } from 'react-native';

const  ImageRestau = (props) => {
  let getImage = props.restau.image;
  console.log(props.restau.image);

  return (
    <View style={styles.combine_components}>
    <Image source={require('../../App_Resources/iOS/background@3x.png')} style={{width:100% hei}}/>
      <Text>{props.restau.name}</Text>
    <Image source={{uri: getImage}}  style={styles.photo}
  //  <Image source={require('../../App_Resources/iOS/desGascons@3x.png')}
            />
              <Text>{props.restau.description}</Text>
    </View>
  )
}

export default ImageRestau

const styles = StyleSheet.create({

  combine_components:{
    marginTop:'40%',
    width: '100%',
    height: '50%',
    color:'blue',
    display: 'flex',
    flexDirection:'row'
  },
  photo:{
    width: '70%',
    height: '300%',
    borderColor:'50%'
  },
  btn:{
    width: '60%',
    height: '100%',
    borderColor:'50%'
  },
})
